import http from "./httpService";
import { quoteUrl } from "../config.json";

export function getQuote(content) {
  const apiEndpoint =
    quoteUrl +
    "/US" +
    "/" +
    content.currency +
    "/en-US" +
    "/" +
    content.origin +
    "/" +
    content.destination +
    "/" +
    content.outbound;
}
